import './ProductSecSection.css';
import tickImage from "../images/tick.png";

const ProductSecSection = () => {
  return (
    <div className="product-container">
      <div className="box">
        <p>Startup</p>
          <h1 className="amount">$800<sup class="sup-month">/month</sup></h1>
          <button class="btn btn--product">Get Started</button>
          <div>
         <div className="tick-container">
      <img src={tickImage} alt="Tick" className="tick-image" />
      <span className="tick-text">Here</span>
    </div>
    </div>
      </div>
      <div className="box"></div>
    </div>
  );
}

export default ProductSecSection;
